import './index.css';

function Box(props){
    return (<div className="container">
        <img src={props.imgsrc} alt="myPic"></img>
        <h2>{props.name}</h2>
        <p>NETFLIX Original Cartoon</p>
        <a><button>watch now</button></a>
    </div>)
}

function Navbar(){
    return(
        <nav className='navbar'>
            <div className="logo"><img src="imgs\NetflixLogoBlack.jpeg"></img></div>
            <a className='join'><button>JOIN NOW</button></a>
            <a className='sign'><button>SIGN IN</button></a>
        </nav>
    )
}

export default Box;
export {Navbar};
